import React from "react";

const Navbar = () => {
  return (
    <React.Fragment>
      <nav>
        <ul className="nav-left">
          <li>Home</li>
          <li>Host Your Own</li>
          <li>My Hostings</li>
          <li>About Us</li>
        </ul>
        <ul>
          <li className="nav-right">
            <button>Sign Up</button>
            <button>Log In</button>
          </li>
        </ul>
      </nav>

      <style jsx>{`
        nav {
          height: 55px;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Navbar;
